B.aI6=new A.r('Material 3 ColorScheme is used and fully supported. However, many components in Flutter 3.0 do still not use the updated ColorScheme\'s new colors by default as specified in M3 guide.\n\nWhen you enable FlexColorScheme\'s component sub-themes you get a theme that is close to the Material 3 style without using the M3 toggle in ThemeData. With the component sub-themes settings you can adjust it further, and e.g. change which ColorScheme color each component uses. This is a convenient way to select and use any ColorScheme based color, as the themed color for components included in FlexColorScheme\'s supported component theme customization capabilities.\n\nOnly some widgets in Flutter 3.0 implement M3 correctly. If you disable FlexColorScheme and set "useMaterial3:true" with toggle below, you can see which components currently get the new M3 styling.\n\nIn Flutter SDK 3.0 there are Material widget elevation issues if you set "useMaterial3:true". For example Dialogs, Drawers, BottomSheet, PopupMenu and most Material using widgets will not get any elevation when it is used. This is due to a change in the Material elevation behavior when M3 is used. For elevation in M3, Material needs to specify shadowColor, and optionally surfaceTintColor. For custom Material widgets you can do this, but SDK widgets using Material that do not yet implement their own M3 behaviour, do not do so yet, and do not get any elevation, even if they should in M3 design as well.\n\nWhen you combine "useMaterial3:true" and FlexColorScheme opinionated component theming, FCS will default some widgets with unspecified property values to its M3 defaults, instead of using its own opinionated default.',null,null,null,null,null,null,null,null,null,null)
