B.aHa=new A.r("Use the Themes Playground to try features and themes of FlexColorScheme. Find a scheme you like, experiment with surface blends at different levels. See how AppBar theme options work. Test the true black option for dark themes, along with computed dark themes.\n\nMaterial 3 based ColorScheme is supported and used by built-in schemes. ColorSchemes can also be generated using main built-in scheme colors as ColorScheme seed keys. You can use primary color as seed key, like with in ColorScheme.fromSeed, but you also have more options. You can use secondary and tertiary colors, in addition to primary as key colors to seed your dynamic ColorScheme. You can even customize the tonal palette generation parameters. For branding purposes you can lock selected main colors to their defined input values, while other colors are still seed generated.\n\nThis application does not adjust any individual widget properties. The theme is adjusted interactively and all Flutter widgets change as the app theme is modified interactively via their controls.\n\nThe theming settings and their impact on widgets are shown in widget topic panels. The same panels are used on two screens with different layouts. The default one is a page view, where you see one topic at a time. The second screen is a large masonry grid view, where you can see many topics at once on large screens. You can open and close topics to view more or fewer of them at the same time.\n\nBoth layouts are responsive and work well down to phone sizes. If you build this app, it fits and runs nicely on modern phones. The app is however primarily intended to be used on web based desktop browsers, or as a native Windows, Mac or Linux desktop app, where it shines.\nThe three first themes in the app are example custom color schemes, made in the tutorials with the API, they are not built-in choices in the package. In the package tutorials you learn how to make your own custom color schemes and turn them into advanced themes with FlexColorScheme.\n\nAll settings in this demo are persisted locally.",null,null,null,null,null,null,null,null,null,null)
